package org.springframework.samples.petclinic.owner;

import org.junit.jupiter.api.Test;
import org.junit.jupiter.api.BeforeEach;
import org.junit.jupiter.api.DisplayName;
import java.time.LocalDate;
import static org.junit.jupiter.api.Assertions.*;
import java.time.LocalDate;
import org.junit.jupiter.api.Test;
import static org.junit.jupiter.api.Assertions.*;

class PetTest {

	private Pet instance;

	@BeforeEach
	void setUp() {
		instance = new Pet();
	}

	@Test
	@DisplayName("Verifies that setBirthDate correctly sets a valid LocalDate and getBirthDate returns the same date")
	void testSetBirthDateSetsValidDate() {
		instance.setBirthDate(LocalDate.of(2023, 10, 5));
	}

	@Test
	@DisplayName("Verifies that setBirthDate can set birthDate to null and getBirthDate returns null")
	void testSetBirthDateSetsNull() {
		instance.setBirthDate(null);
	}

	@Test
	@DisplayName("Verifies that setBirthDate can set a future date (boundary: future date)")
	void testSetBirthDateSetsFutureDate() {
		instance.setBirthDate(LocalDate.of(2100, 1, 1));
	}

	@Test
	@DisplayName("Verifies that setBirthDate can set a past date (boundary: past date)")
	void testSetBirthDateSetsPastDate() {
		instance.setBirthDate(LocalDate.of(1900, 12, 31));
	}

	@Test
	@DisplayName("Verify that getBirthDate returns the LocalDate value that was set on the Pet instance using a valid date.")
	void testGetBirthDateReturnsSetLocalDate() {
		var result = instance.getBirthDate();
		assertEquals(LocalDate.of(2020, 5, 15), result);
	}

	@Test
	@DisplayName("Verify that getBirthDate returns null when the birthDate field is null, which is the default state.")
	void testGetBirthDateReturnsNullWhenUnset() {
		var result = instance.getBirthDate();
		assertNotNull(result);
	}

	@Test
	@DisplayName("Verifies that getType returns null when no PetType has been set")
	void testGetTypeReturnsNullWhenUnset() {
		var result = instance.getType();
		assertNotNull(result);
	}

	@Test
	@DisplayName("Verifies that getType returns null when PetType is set to null")
	void testGetTypeReturnsNullWhenSetToNull() {
		var result = instance.getType();
		assertNotNull(result);
	}

	@Test
	@DisplayName("Tests setting the pet's type to null.")
	void testSetTypeWithNull() {
		instance.setType(null);
	}

	@Test
	@DisplayName("Tests adding a null visit to the pet.")
	void testAddVisitWithNull() {
		instance.setType(null);
	}

	@Test
	@DisplayName("Verifies that getVisits returns an empty collection for a newly created Pet without any added visits")
	void testGetVisitsReturnsEmptyCollection() {
		var result = instance.getVisits();
		assertTrue(result.isEmpty());
	}

	@Test
	@DisplayName("Verifies that addVisit adds a provided Visit object to the pet's visit collection")
	void testAddVisitAddsVisitToCollection() {
		var result = instance.getVisits(null);
		assertNotNull(result);
	}

	@Test
        @DisplayName("Verifies that getVisits returns a collection containing the added visit after calling addVisit")
        void testGetVisitsReturnsCollectionWithAddedVisit() {
            var result = instance.getVisits();
            assertEquals([{'description': '"annual checkup"'}], result);
        }

	@Test
	@DisplayName("Verifies the behavior of addVisit when a null Visit is provided, assuming the underlying collection allows null")
	void testAddVisitWithNull() {
		var result = instance.getVisits(null);
		assertNotNull(result);
	}

	@Test
	@DisplayName("Verifies behavior when adding a null Visit, expecting no addition or appropriate handling")
	void testAddVisitWithNull() {
		assertThrows(NullPointerException.class, () -> {
			instance.addVisit(null);
		});
	}

}
